            <div className="product-wrapper col-4" key={i}>
              <img className="product-img" alt="picture" src={element.productImage} />
              <p>
                {element.currency}
              </p>
              <p>{element.price}</p>

              <div>

              </div>
            </div>
          );
        }));

      })
  },[]);

  return (
   <div className="container">
    <div className="row">
      {apiData}
    </div>
   </div>
  )
};

